import React from 'react';
import Heading, {sum,sub,mult,div} from './Heading';


function App() {
    return (
        <>
        <h3> {name}</h3>
        <h3> {college}</h3>
        <h3> {school}</h3>
        <Heading />
        <h3> {movie()}</h3>
        <h3> {series()}</h3>
        <Para />
        </>
    );
}


export default App;
